/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"page-header\">\n    <img class=\"d-block w-100\" height=\"300px\" src=\"assets/images/title_background.jpg\" alt=\"First slide\">\n    <div class=\"container\">\n        <div class=\"carousel-caption page-title text-left\">\n            <h2>Solar Water Heater</h2>\n        </div>\n    </div>\n</div>\n<div class=\"container marketing\">\n    <div class=\"row\">\n        <div class=\"w-100 text-center\">\n            <h3 class=\"featurette-heading underline\"></h3>\n        </div>\n        <div class=\"col-md-6 order-md-1\">\n            <p class=\"lead\">\n                A solar water heater is a system that utilizes solar energy (or the energy from sunlight) to\n                heat water. It has a system that is installed on a terrace or open space where it can get\n                sunlight and the energy from the sun is then used to heat water and store it in an insulated\n                tank. The system is not connected to electricity supply and thus does not have an on-off\n                switch, but it uses the sunlight throughout the day to heat the water and store it in the\n                storage tank. Most of the solar water heater on a sunny day can provide heater water at about\n                68° ±5° C temperature. Water from the storage tank can then be used for any application as desired.\n            </p>\n        </div>\n        <div class=\"col-md-6 order-md-2\">\n            <img width=\"100%\" height=\"350px\" src=\"assets/images/water_heater.jpg\" alt=\"First slide\">\n        </div>\n    </div>\n    <div class=\"row lead\">\n        There are 2 types of solar water heaters.\n        <ul>\n            <li>\n                <b>FPC (Flat Plate Collectors) system:</b> Flat Plate Collector Systems are metallic systems.\n                They contain an insulated metallic box covered with a toughened glass. The metallic box has a\n                layer of a copper sheet with black coating which is good for absorbing heat. The metallic box\n                contains copper tubes arranged vertically and connected at the top and bottom by two horizontal\n                copper pipes called headers. The cold water enters the collector from the bottom pipe and rises\n                up into the vertical pipes. It gets heated up in the vertical pipes. As it gets heated the water\n                becomes lighter and it rises up and gets collected in the storage tank via the top horizontal pipe.\n            </li>\n            <li>\n                <b> ETC (Evacuated Tube Collectors) system:</b> Evacuated Tube Collector systems are made of Glass.\n                It has vertical tubes that are made out of two co-axial glass tubes. The air between the two\n                coaxial tubes is removed to create a vacuum which improves insulation. Additionally, the surface\n                of the inner tube is coated to provide better heat absorption and insulation. Coldwater is filled\n                up in these glass tubes and it gets heated up due to the sunlight. Hot water is lighter than cold\n                water, and so it rises up and gets collected in the storage tank from where it is available for use.\n            </li>\n        </ul>\n        <br />\n        <div>\n            <b>Benefits of Solar Water Pumps</b>\n            <ul>\n                <li>Simple and highly reliable</li>\n                <li>Reduces Electricity Bills</li>\n                <li>Contribute to the “Green Economy”</li>\n                <li>Extremely low operating and maintenance cost</li>\n                <li>Uses Renewable Energy Source</li>\n                <li>Can be installed quickly</li>\n            </ul>\n        </div>\n    </div>\n</div>");

